import React, { Component } from "react";

class MenuCategory extends Component {
	state = {};

	constructor(props) {
		super(props);
		var map = new Map();
		this.state = { map };
	}

	componentDidMount() {
		this.state.map.set("fillings", require("./menu/fillings.js"));
		console.log(this.state.map.get("fillings"));
	}

	render() {
		return <div className="container"></div>;
	}
}

export default MenuCategory;
